import './App.css';
import React from 'react';
import { Route, Routes } from 'react-router-dom';
import RedirectPage from './RedirectPage';

const App = () => {
  return (
    <Routes>
      <Route path="/" Component={YourMainReactWebsiteComponent} />
      <Route path="/other-react-website" Component={YourOtherReactWebsiteComponent} />
      <Route path="/redirect" Component={RedirectPage} />
    </Routes>
  );
};

export default App;
